MOD = 10 ** 9 - 7
jumps = [[4, 6], [6, 8], [7, 9], [4, 8], [3, 9, 0], [], [1, 7, 0], [2, 6], [1, 3], [2, 4]]

def knightDialer(n):
    dp = [[0] * 10 for _ in range(n + 1)]
    for j in range(10):
        dp[1][j] = 1
    for i in range(2, n + 1):
        for j in range(10):
            for k in jumps[j]:
                dp[i][j] = (dp[i][j] + dp[i - 1][k]) % MOD
    return sum(dp[n][1:]) % MOD

